import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import RecipeRoom from "./components/RecipeRoom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<RecipeRoom/>}/>
      </Routes>
    </Router>
  );
}
export default App;
